import { createMuiTheme } from '@material-ui/core/styles';
import deepPurple from '@material-ui/core/colors/deepPurple';

const theme = createMuiTheme({
    palette: {
        primary: deepPurple,
        secondary: {
            main: '#BB85F9',
        },
    },
});

export default theme;
